Calculate avg in group for a field which represents array<p>I have the following document: </p>

<pre><code>{
"name":"St Peterburg",
"checkInAt" : ISODate(...),
"areas": [
        {"length":2.0; "width":3.0}, 
        {"length":4.0; "width":3.0}, 
        {"length":2.0; "width":1.0}
       ]

}
</code></pre>

<p>I need a query which would group these documents by day and for each group calculate a single decimal which is equal to average of all (length * width) among all areas arrays in the group. So, if in a group I have two documents: </p>

<pre><code>A { areas:[{"length":2; "width":3}; {"length":3; "width":4};], 
B { areas:[{"length":4; "width":5}; {"length":5; "width":6};]
</code></pre>

<p>I would need to calculate <code>X = avg(2*3;3*4;4*5;5*6)</code>;</p>

<p>So far my query looks like:</p>

<pre><code>db.getCollection('areas').aggregate([
        {
            "$group": {
                "_id": {
                    "$dateToString": {
                        "format": "%Y-%m-%d",
                        "date": "$checkInAt"
                    }
                },

                "avgArea": {$avg: {"$multiply":["$$areas.length","$$areas.width"]}}
            }
        }
    ])
</code></pre>

<p>But this doesn't work, </p>

<p>Would be really grateful for the hints of how can I make it work</p>

